// src/store/reducers/exampleReducer.js
const initialState = {
  // Başlangıç state'inizi belirleyin
};

const exampleReducer = (state = initialState, action) => {
  switch (action.type) {
    // Action tiplerine göre state güncellemelerini tanımlayın
    default:
      return state;
  }
};

export default exampleReducer;
